import { Route, Routes } from 'react-router-dom';
import Download_page from './Downloadpage';

function Navigation() {
    return (
        <nav className="wrapper-top">
            <Routes>
                <Route path="/" exact element={<app />} />
                <Route path='/downloadpage' exact element={<Download_page />} />
            </Routes>

                <a className="nav-item" href="/">AidALL</a>

                    <li className="nav-right">
                        <li className="nav-item"><a className="nav-link" href="#about">소개</a></li>
                        <li className="nav-item"><a className="nav-link" href="#vision">비전</a></li>
                        <li className="nav-item"><a className="nav-link" href="#services">서비스</a></li>
                        <li className="nav-item"><a className="nav-link" href="downloadpage">Download</a></li>
                        <li className="nav-item"><a className="nav-link" href="#contact">Contact</a></li>
                    </li>


        </nav>
    );
}

export default Navigation;
